SELECT COALESCE("t2"."n_name", "t2"."n_name") AS "n_name", "t2"."r_name", ANY_VALUE("t2"."n_name") AS "NATIONNAME", ANY_VALUE("t2"."r_name") AS "REGIONNAME", COUNT(DISTINCT "t2"."s_suppkey") AS "TOTALSUPPLIERS", SUM(CASE WHEN "t2"."ps_availqty" IS NOT NULL THEN CAST("t2"."ps_availqty" AS BIGINT) ELSE 0 END) AS "TOTALAVAILABLEQUANTITY", AVG("t2"."s_acctbal") AS "AVGACCOUNTBALANCE", LISTAGG(DISTINCT "t2"."s_name", ', ') AS "SUPPLIERNAMES", MAX(CASE WHEN "orders"."o_orderstatus" = 'F' THEN "orders"."o_orderkey" ELSE NULL END) AS "LASTFINISHEDORDER", SUM(CASE WHEN "t2"."l_discount" > 0.10 THEN "t2"."l_extendedprice" * (1 - "t2"."l_discount") ELSE 0.0000 END) AS "DISCOUNTEDREVENUE", COUNT("t2"."s_suppkey") AS "FD_COL_10"
FROM (SELECT "n_nationkey"
FROM "TPCH"."nation"
GROUP BY "n_nationkey") AS "t"
INNER JOIN ((SELECT "t1"."n_nationkey", "t1"."n_name", "t1"."n_regionkey", "t1"."n_comment", "t1"."r_regionkey", "t1"."r_name", "t1"."r_comment", "t1"."s_suppkey", "t1"."s_name", "t1"."s_address", "t1"."s_nationkey", "t1"."s_phone", "t1"."s_acctbal", "t1"."s_comment", "t1"."ps_partkey", "t1"."ps_suppkey", "t1"."ps_availqty", "t1"."ps_supplycost", "t1"."ps_comment", "lineitem"."l_orderkey", "lineitem"."l_partkey", "lineitem"."l_suppkey", "lineitem"."l_linenumber", "lineitem"."l_quantity", "lineitem"."l_extendedprice", "lineitem"."l_discount", "lineitem"."l_tax", "lineitem"."l_returnflag", "lineitem"."l_linestatus", "lineitem"."l_shipdate", "lineitem"."l_commitdate", "lineitem"."l_receiptdate", "lineitem"."l_shipinstruct", "lineitem"."l_shipmode", "lineitem"."l_comment"
FROM "TPCH"."lineitem"
RIGHT JOIN (SELECT "t0"."n_nationkey", "t0"."n_name", "t0"."n_regionkey", "t0"."n_comment", "t0"."r_regionkey", "t0"."r_name", "t0"."r_comment", "t0"."s_suppkey", "t0"."s_name", "t0"."s_address", "t0"."s_nationkey", "t0"."s_phone", "t0"."s_acctbal", "t0"."s_comment", "partsupp"."ps_partkey", "partsupp"."ps_suppkey", "partsupp"."ps_availqty", "partsupp"."ps_supplycost", "partsupp"."ps_comment"
FROM "TPCH"."partsupp"
RIGHT JOIN (SELECT "nation0"."n_nationkey", "nation0"."n_name", "nation0"."n_regionkey", "nation0"."n_comment", "region"."r_regionkey", "region"."r_name", "region"."r_comment", "supplier"."s_suppkey", "supplier"."s_name", "supplier"."s_address", "supplier"."s_nationkey", "supplier"."s_phone", "supplier"."s_acctbal", "supplier"."s_comment"
FROM "TPCH"."supplier"
RIGHT JOIN ("TPCH"."nation" AS "nation0" INNER JOIN "TPCH"."region" ON "nation0"."n_regionkey" = "region"."r_regionkey") ON "supplier"."s_nationkey" = "nation0"."n_nationkey") AS "t0" ON "partsupp"."ps_suppkey" = "t0"."s_suppkey") AS "t1" ON "lineitem"."l_partkey" = "t1"."ps_partkey") AS "t2" LEFT JOIN "TPCH"."orders" ON "t2"."l_orderkey" = "orders"."o_orderkey") ON "t"."n_nationkey" = "t2"."n_nationkey"
GROUP BY "t2"."n_name", "t2"."r_name"
HAVING COUNT("t2"."s_suppkey") > 0